export default {
    namespaced:true,
    state:{
        tableData:[]
    },
    mutations:{
        setTableData(state,data){

            data.forEach((i,v)=>{
                if(i.checkStatus==0){
                    i.checkStatus='审核中'
                }
                
            })

            state.tableData=data
        },
        
    }

}
